import {
    Card, CardBody, CardTitle, CardText
} from "reactstrap";


const JobCard = ({ title, salary, equity, companyName }) => {
    return (
        <section>
            <Card>
                <CardBody>
                    <CardTitle className="font-weight-bold text-center">
                        {title}

                    </CardTitle>
                    <CardText className="font-italic">
                        <p>{companyName} </p>
                        <p>Salary: {salary}</p>
                        <p>Equity: {equity}</p>
                    </CardText>

                </CardBody>
            </Card>
        </section>
    )

};
export default JobCard;
